CJOrtho is an application for orthopedic surgeons and health professionals treating musculoskeletal disorders. Developed by the College of Young Orthopedists, it represents a decision support and management of patients consulting for a musculoskeletal disorder. It also facilitates clinical evaluation and pre- and post-operative follow-up.

The application includes four tools:
• The classifications most frequently used in Orthopedics Traumatology;
• The main clinical scores per joint for the follow-up of your patients;
• A goniometer;
• A database for keeping patient information and linking it to the other tools in the application.

